var title_f38_20_39240="NASH Light";
var content_f38_20_39240=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F51497%7EGAST%2F75188&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F51497%7EGAST%2F75188&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 563px\">",
"   <div class=\"ttl\">",
"    Nonalcoholic steatohepatitis on biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 543px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Histologic changes in nonalcoholic steatohepatitis (NASH). Left panel: The hepatocyte in the center contains a large vacuole of fat and deeply staining eosinophilic strands of cytoplasmic hyalin. Numerous neutrophils and phagocytic cells containing golden brown pigmented material (bile components and cellular debris) are present in the sinusoids. Right panel: NASH with cirrhosis. Trichrome stain shows regenerating nodules with fat surrounded by fibrous tissue.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mallory-Denk bodies in alcoholic hepatitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 442px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a liver biopsy in alcoholic hepatitis shows macrovesicular fat and Mallory-Denk bodies (arrows), which are eosinophilic accumulations of intracellular material. Similar changes can occur in nonalcoholic steatohepatitis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
