"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        QTc interval",
"       </td>",
"       <td class=\"subtitle1\">",
"        P wave",
"       </td>",
"       <td class=\"subtitle1\">",
"        PR interval",
"       </td>",
