"        Arrhythmias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"7\">",
"        HCM",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        (Left atrial enlargement)",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Increased voltages in mid-left precordial leads; abnormal Q waves in inferior and/or lateral leads;&nbsp;(LAD, LBBB); (delta wave)",
"       </td>",
"       <td>",
"        Down-sloping (up-sloping)",
"       </td>",
"       <td>",
"        Inverted in mid-left precordialleads; (giant&nbsp;and negative in the apical variant)",
"       </td>",
"       <td>",
"        (Atrial fibrillation); (PVB); (VT)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"7\">",
"        Arrhythmogenic right ventricular cardiomyopathy/dysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Prolonged &gt;110 ms in right precordial leads; epsilon wave in right precordial leads; reduced voltages &le;0.5 mV in frontal leads; (RBBB)",
"       </td>",
"       <td>",
"        (Up-sloping in right precordial leads)",
"       </td>",
"       <td>",
"        Inverted right in&nbsp;precordial&nbsp;leads",
"       </td>",
"       <td>",
"        PVB with aLBBB pattern; (VT with a&nbsp;LBBB pattern)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"7\">",
"        Dilated cardiomyopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        (Left atrial enlargement)",
"       </td>",
"       <td>",
"        (Prolonged &ge;0.21 s)",
"       </td>",
"       <td>",
"        LBBB",
"       </td>",
"       <td>",
"        Down-sloping (up-sloping)",
"       </td>",
"       <td>",
"        Inverted in inferior and/or lateral leads",
"       </td>",
"       <td>",
"        PVB; (VT)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"7\">",
"        Long QT syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prolonged",
"       </td>",
"       <td rowspan=\"3\">",
"        Normal",
"       </td>",
"       <td rowspan=\"3\">",
"        Normal",
"       </td>",
"       <td rowspan=\"3\">",
"        Normal",
"       </td>",
"       <td rowspan=\"3\">",
"        Normal",
"       </td>",
"       <td rowspan=\"3\">",
"        Bifid or biphasic in all leads",
"       </td>",
"       <td rowspan=\"3\">",
"        (PVB); (torsade de pointes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &gt;440 ms in males",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &gt;460 ms in females",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
